input = ''''''

part_1 = 0
for i in range(0, len(input) - 4, 1):
    current_1 = input[i:i+4]
    if len(set(current_1)) == 4:
        part_1 = i + 4
        break

print(f"Part 1: {part_1}")

part_2 = 0
for i in range(0, len(input) - 14, 1):
    current_2 = input[i:i+14]
    if len(set(current_2)) == 14:
        part_2 = i + 14
        break

print(f"Part 2: {part_2}")
